INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (1, 'Austria', 'AT', 'Vienna', 8316487, 'Austria is divided into nine Bundesländer, or simply Länder (states; sing. Land).', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (2, 'Belgium', 'BE', 'Bruxelles', 10584534, 'Belgium is divided into ten provinces (Flemish: provincies) and one capital region (Flemish: hoofdstedelijke gewest; French: région capitale).', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (3, 'Denmark', 'DK', 'Copenhagen', 5475791, 'Denmark is divided into five regioner (regions; singular: region) and 98 municipalities (Danish, kommuner).', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (4, 'Finland', 'FI', 'Helsinki', 5311891, 'Finland is divided into five läänit (sing. lääni, Swedish län: provinces) and one itsehallinnollinen maakunta (autonomous province), namely Åland. ', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (5, 'France', 'FR', 'Paris', 64473140, 'France, in Europe and adjacent islands (Corsica), is divided into 96 départements (departments). It also has a number of possessions, some of which are classified as départements d''outre-mer (overseas departments). ', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (6, 'Germany', 'DE', 'Berlin', 82210000, 'Germany is divided into sixteen Länder (sing. Land: state).', 1);
