INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (8, 'Italy', 'IT', 'Roma', 59536507, 'Italy is divided into 110 province (sing. provincia: provinces).', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (9, 'Netherlands', 'NL', 'Amsterdam', 16408557, 'The Netherlands is divided into twelve provincies (provinces).', 1);
