INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (12, 'Portugal', 'PT', 'Lisbon', 10623032, 'Portugal is divided into eighteen distritos (districts) and two regiões autônomas (autonomous regions).', 1);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (13, 'Spain', 'ES', 'Madrid', 45200737, 'Spain is politically organized into 17 Autonomous Communities (comunidades autónomas) and 2 autonomous cities (ciudades autónomas) - Ceuta and Melilla. Administratively Spain also comprises fifty provinces.', 1);
