INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (21, 'Japan', 'JP', 'Tokyo', 127433494, 'Japan is divided into 43 ken (prefectures), one to (metropolis - Tokyo), one do (Area - Hokkaido), and two fu (urban prefectures - Kyoto and Osaka). The four words are combined in one, todofuken, to denote a division of any type.', 3);
INSERT INTO Country (CountryKey, CountryName, CountryCode, CountryCapital, Population, Subdivision, ContinentKey) VALUES (22, 'Singapore', 'SG', 'Singapore', 4588600, ' The small physical size of Singapore does not justify the creation of national subdivisions in the form of provinces, states, and other national political divisions found in larger countries', 3);
